css:
atom-text-editor,
:host {
  background-color: #1e1e1e;
  color: #f5f7f4;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #212121;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #444444;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #444444;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #212121;
  color: #969896;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #1e1e1e;
  color: #f42156;
  font-weight: bold;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #34ac9a;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #f5f7f4;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #494949;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #444444;
}
.comment .storage {
  color: #5e5e5e;
}
.entity.name.type {
  color: #eca72c;
  font-weight: bold;
}
.entity.other.inherited-class {
  color: #34ac9a;
}
.keyword.control {
  color: #f42156;
  background: #402444;
}
.keyword.operator {
  color: #f5f7f4;
}
.keyword.other.special-method {
  color: #ffffff;
}
.keyword.other.unit {
  color: #9083db;
}
.storage {
  color: #34ac9a;
  font-weight: bold;
}
.constant {
  color: #9083db;
}
.constant.character.escape {
  color: #f42156;
}
.constant.numeric {
  color: #9083db;
}
.constant.other.color {
  color: #f42156;
}
.constant.other.symbol {
  color: #34ac9a;
}
.variable {
  color: #34ac9a;
}
.variable.interpolation {
  color: #288577;
}
.variable.parameter.function {
  color: #f5f7f4;
}
.variable.other {
  color: #eca72c;
  font-weight: bold;
}
.invalid.illegal {
  background-color: #34ac9a;
  color: #1e1e1e;
}
.string {
  color: #eca72c;
}
.string.regexp {
  color: #f42156;
}
.string.regexp .source.ruby.embedded {
  color: #9083db;
}
.string.other.link {
  color: #34ac9a;
}
.punctuation.definition.comment {
  color: #444444;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #f5f7f4;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #ffffff;
}
.punctuation.definition.bold {
  color: #9083db;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #34ac9a;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #288577;
}
.support.class {
  color: #9083db;
  font-weight: bolder;
}
.support.function {
  color: #f42156;
  background: #402444;
}
.support.function.any-method {
  color: #ffffff;
}
.entity.name.function {
  color: #ffffff;
  font-weight: bolder;
}
.entity.name.class,
.entity.name.type.class {
  color: #9083db;
}
.entity.name.section {
  color: #ffffff;
}
.entity.name.tag {
  color: #34ac9a;
}
.entity.other.attribute-name {
  color: #eca72c;
}
.entity.other.attribute-name.id {
  color: #ffffff;
}
.meta .css .punctuation.definition {
  color: #f42156;
}
.meta .css .punctuation.definition.entity {
  color: #eca72c;
}
.meta .css .constant {
  color: #f42156;
}
.meta .scss .variable {
  color: #eca72c;
}
.meta .scss.keyword {
  color: #f42156;
}
.meta .string {
  color: #ffffff;
}
.meta .string.json {
  color: #eca72c;
}
.meta.class {
  color: #9083db;
}
.meta.link {
  color: #9083db;
}
.meta.require {
  color: #ffffff;
}
.meta.selector {
  color: #34ac9a;
}
.meta.separator {
  background-color: #444444;
  color: #f5f7f4;
}
.none {
  color: #f5f7f4;
}
.markup.bold {
  color: #9083db;
  font-weight: bold;
}
.markup.changed {
  color: #34ac9a;
}
.markup.deleted {
  color: #34ac9a;
}
.markup.italic {
  color: #34ac9a;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #ffffff;
}
.markup.inserted {
  color: #34ac9a;
}
.markup.list {
  color: #34ac9a;
}
.markup.quote {
  color: #9083db;
}
.markup.raw.inline {
  color: #34ac9a;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #34ac9a;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
